import './App.css';
import Navbar from './Components/Navbar';
import Hollywood from './Components/Hollywood_movies';
import Hindi from './Components/Hindi_movies';
import Top10Movies from './Components/Top_10_movies';
import { Routes, Route, Link } from "react-router-dom";
import H1 from './Components/movie_card_all_data/HollywoodMovies/holly-1/h-1'

function App() {

  return (<>
    <Navbar />
    <Hollywood />
    <Hindi/>
    <Top10Movies/>
    <Routes>
        <Route path="/H1" element={<H1/>} />

      </Routes>
    </>
  )
}

export default App;
